script: |
  super -f text -I q7702.spq | sort > q7702.out

inputs:
  - name: q7702.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + - col2 / 84 * col1 * + - col2 * ( + col0 ) - 18 * 99 BETWEEN 66 * col2 - col2 * 51 AND + col2;
  - name: tab2

outputs:
  - name: q7702.out
    data: |
      46	51	23
      64	77	40
      75	67	58
